import React, { Component } from 'react'
import './Footer.css'

export class Footer extends Component {
    render() {
        return (
            <div>
                <h2>Fixed/Sticky Footer Example</h2>
                <p>The footer is placed at the bottom of the page.</p>

                <div className="footer">
                <p>Footer</p>
                </div>
            </div>
        )
    }
}

export default Footer
